import express, { Express } from 'express';
import ListController from './src/Controller/ListController';
import PrismaOrm from './src/helper/PrismaOrm';
import ListModel from './src/Model/ListModel';
import App from './src/Server/App';
import ListServer from './src/Service/ListServer';

export const server: Express = express();
const PORT: number = 3001;

export const orm = new PrismaOrm();

const listModel = new ListModel(orm)
const listService = new ListServer(listModel);
const listController = new ListController(listService);

const app = new App(server, PORT, listController);

app.start();

import { NextFunction, Request, Response } from 'express';
import IListController from '../Interface/controller';
import IListService from '../Interface/service';
import IStatusCode from '../Interface/statusCode';

export default class ListController implements IListController {
  constructor(private listService: IListService) {}

  public async findAll(_req: Request, res: Response): Promise<Response> {
    const list = await this.listService.findAll();

    return res.status(200).json(list);
  }

  public async create(req: Request, res: Response): Promise<Response> {
    const { task, status, responsible } = req.body;

    const list = await this.listService.create({ task, status, responsible });

    return res.status(201).json(list);
  }

  public async update(req: Request, res: Response, next: NextFunction): Promise<Response | void> {
    const { id } = req.params;
    const { task, status, responsible } = req.body;

    const list = await this.listService.update({ task, status, responsible }, Number(id));

    const { statusCode } = list as IStatusCode;
    return typeof (statusCode) !== 'undefined'
      ? next(list)
      : res.status(201).json(list);
  }

  public async delete(req: Request, res: Response, next: NextFunction): Promise<Response | void> {
    const { id } = req.params;

    const list = await this.listService.delete(Number(id));

    const { statusCode } = list as IStatusCode;
    return typeof (statusCode) !== 'undefined'
      ? next(list)
      : res.status(200).json(list);
  }
}

import { PrismaClient } from "@prisma/client";
import IList from "../Interface/list";
import IOrm from "../Interface/prisma";

export default class PrismaOrm implements IOrm {
  private prismaOrm = new PrismaClient();

  public async findOne(id: number): Promise<IList | null> {
    const prisma = await this.prismaOrm.table.findFirst({ 
      where: { id }
    });

    return prisma;
  }

  public async findAll(): Promise<IList[]> {
    const prisma = await this.prismaOrm.table.findMany();

    return prisma;
  }

  public async create(data: IList): Promise<IList> {
    const prisma = await this.prismaOrm.table.create({ data });

    return prisma;
  }

  public async update(data: IList, id: number): Promise<IList> {
    const prisma = await this.prismaOrm.table.update({
      where: { id },
      data,
    });

    return prisma;
  }

  public async delete(id: number): Promise<IList> {
    const prisma = await this.prismaOrm.table.delete({
      where: { id }
    });

    return prisma;
  }
}

