import express, { Express, Request, Response, RequestHandler } from 'express';
const cors = require('cors');
import 'express-async-errors';
import IListController from '../Interface/controller';
import ErrorMiddleware from '../Middleware/ErrorMiddleware';
import ListRoutes from '../Routes';

export default class App {
  private listRoutes = new ListRoutes(this.listController ,express.Router());

  constructor(
    private app: Express,
    private PORT: number,
    private listController: IListController
  ) {
    this.config();
    this.routes();
  }

  private routes() {
    this.app.get('/', (_req: Request, res: Response) => {
      res.status(200).json('OK');
    });

    this.app.use('/api/todo-list', this.listRoutes.router);

    this.app.use(ErrorMiddleware.handleError);
  }

  private config() {
    const accessControl: RequestHandler = (_req, res, next) => {
      res.header('Access-Control-Allow-Origin', '*');
      res.header('Access-Control-Allow-Methods', 'GET,POST,DELETE,OPTIONS,PUT,PATCH');
      res.header('Access-Control-Allow-Headers', '*');
      next();
    };

    this.app.use(express.json());
    this.app.use(accessControl);
    this.app.use(cors());
  }

  public start(): void {
    this.app.listen(this.PORT, () => {
      console.log(`Ouvindo na porta ${this.PORT}`);      
    });
  }
}

import { NextFunction, Request, Response } from "express";

export default class ErrorMiddleware {
  static handleError(
    err: any,
    _req: Request,
    res: Response,
    _next: NextFunction
  ): Response {
    if (err.statusCode) {{
      const { code, message } = err.statusCode;

      return res.status(code).json({ message });
    }}

    return res.status(500).json({ message: err.message });
  }
}

import { NextFunction, Request, Response, Router } from "express";
import IListController from "../Interface/controller";

export default class ListRoutes {
  constructor(private listController: IListController, public router: Router) {
    this.routes();
  }

  private routes() {
    this.router.get(
      '/',
      (req: Request, res: Response) => this.listController.findAll(req, res)
    );
    this.router.post(
      '/',
      (req: Request, res: Response) => this.listController.create(req, res)
    );
    this.router.put(
      '/:id',
      (req: Request, res: Response, next: NextFunction) => this.listController.update(req, res, next)
    );
    this.router.delete(
      '/:id',
      (req: Request, res: Response, next: NextFunction) => this.listController.delete(req, res, next)
    );
  }
}

import IList from "../Interface/list";
import IListModel from "../Interface/model";
import IListService from "../Interface/service";
import IStatusCode from "../Interface/statusCode";

export default class ListServer implements IListService {
  constructor(private listModel: IListModel) {}

  public async findAll(): Promise<IList[]> {
    const list = await this.listModel.findAll();

    return list;
  }

  public async create(data: IList): Promise<IList> {
    const list = await this.listModel.create(data);

    return list;
  }

  public async update(data: IList, id: number): Promise<IList | IStatusCode> {
    const checkId = await this.listModel.findOne(id);

    if (!checkId) {
      return { statusCode:
        { code: 404, message: 'Not Found' } };
    }

    const list = await this.listModel.update(data, id);   

    return list;
  }

  public async delete(id: number): Promise<IList | IStatusCode> {
    const checkId = await this.listModel.findOne(id);

    if (!checkId) {
      return { statusCode:
        { code: 404, message: 'Not Found' } };
    }

    const list = await this.listModel.delete(id);

    return list;
  }
}

